import './table.css';
import Search from '../search/search';
import React, { useState, useEffect } from 'react';
import axios from 'axios';

function Table() {


    const [data, setData] = useState([]);

    /*useEffect(() => {
        async function fetchData() {
            const result = await axios('/values');
            setData(result.data);
        }
        fetchData();
    }, []);*/

    useEffect(() => {
        // Make an HTTP GET request to the backend server using Axios
        axios.get('http://localhost:3001/api/data')
          .then((response) => {
            // Set the data state variable with the response data
            setData(response.data);
            console.log(setData)
          })
          .catch((error) => {
            // Handle any errors that occur during the request
            console.error(error);
          });
      }, []);

    /*useEffect(() => {
        fetch('http://localhost:3001/data')
          .then((response) => response.json())
          .then((data) => setData(data));
      }, []);*/

    return (

        <div>
            <Search data={data} setData={setData}/>
            <table className='blueTable'>
                <thead>
                    <tr>
                        <th>Date</th>
                        <th>Time</th>
                        <th>Pressure Value</th>
                        <th>Technician Name</th>
                        <th>Job Number</th>
                        <th>Serial Number</th>
                        <th>Pass/Fail</th>
                        <th>Notes</th>
                    </tr>
                </thead>
                <tbody>
                    {data.map((row ) => (
                        <tr key={row.pressure_id}>
                            <td>{row.date_collected}</td>
                            <td>{row.time_collected}</td>
                            <td>{row.pressure_value}</td>
                            <td>{row.tech_name}</td>
                            <td>{row.job_num}</td>
                            <td>{row.serial_num}</td>
                            <td>{row.pass_fail}</td>
                            <td>{row.notes}</td>
                        </tr>
                    ))}
                </tbody>
                <tfoot>
                    <tr>
                        <td colSpan="4">
                            <div className="links"><a href="#">&laquo;</a> <a className="active" href="#">1</a> <a href="#">2</a> <a href="#">3</a> <a href="#">4</a> <a href="#">&raquo;</a></div>
                        </td>
                    </tr>
                </tfoot>
            </table>
        </div>
    )
}

export default Table;
